window.bookSummaryJSON = "<p>Billionaire Greek playboy Iakovos Papaioannou knew his sister hired her favorite band to perform at her birthday party. He's just not sure how their six-foot tall, wild-haired, tempestuous manager has already ended up in his bed-and in his heart. Eglantine \"Harry\" Knight is so not his type. She's as infuriating as she is intriguing, and she's can't keep her hands off of him. But she just may be the woman who knocks him off the world's most eligible bachelor list for good.... </p>"; 
